CREATE TABLE IF NOT EXISTS flow_materializations_v2 (
  materialization STRING NOT NULL COMMENT 'The name of the materialization.',
  version STRING NOT NULL COMMENT 'Version of the materialization.',
  spec STRING NOT NULL COMMENT 'Specification of the materialization, encoded as base64 protobuf.'
) COMMENT 'This table is the source of truth for all materializations into this system.';

UPDATE flow_materializations_v2 SET version = 'test', spec = '(a-base64-encoded-value)' WHERE materialization = 'tests/materialize-databricks/materialize';
